import React from 'react';
import CustomNavbar from '../components/Navbar';

function Post() {
  return (
    <>
      <CustomNavbar />
      <div className="post-content">
        <h2>Create a New Listing</h2>
        <p>Fill out the details to post your listing.</p>
      </div>
    </>
  );
}

export default Post;
